import React, { Component } from "react";
import Typography from "@material-ui/core/Typography";
import { makeStyles } from "@material-ui/core/styles";
import GridList from "@material-ui/core/GridList";
import Grid from "@material-ui/core/Grid";

import GridListTile from "@material-ui/core/GridListTile";
import ModalImage from "react-modal-image";
import Fade from "react-reveal/Fade";
import Flip from "react-reveal/Flip";
import Zoom from "react-reveal/Zoom";
import Slide from "react-reveal/Slide";
import Gallery from "react-photo-gallery"
// import tileData from "./tileData";
// import ListHeader from "@material-ui/core/ListHeader";

import "./components.css";
import "./misc.css";

export default class Misc extends Component {
  render() {
    const gcf = [
      {
        src: require("../images/group1.jpg"),
        width: 8,
        height: 3
      },
      {
        src: require("../images/group2.jpg"),
        width: 4,
        height: 3

      },
      {
        src: require("../images/group3.jpg"),
        width: 4,
        height: 3

      },
      {
        src: require("../images/group5.jpg"),
        width: 5,
        height: 3

      }
    ];
    const nature = [
      {
        src: require("../images/nature3.JPG"),
        width: 2,
        height: 3
      },
      {
        src: require("../images/nature1.JPG"),
        width: 2,
        height: 3
      },
      {
        src: require("../images/nature2.JPG"),
        width: 2,
        height: 3
      }
    ];
    const touring = [
      {
        src: require("../images/touring.JPG"),
        width: 2,
        height: 3
      },
      {
        src: require("../images/touring.jpeg"),
        width: 2,
        height: 3
      },
      {
        src: require("../images/touring2.JPG"),
        author: "SJP",
        width: 2,
        height: 3
      }
    ];
    const vw = [
      {
        src: require("../images/vw1.JPG"),
        width: 2,
        height: 3
      },
      {
        src: require("../images/vw14.JPG"),
        width: 2,
        height: 3
      },

      {
        src: require("../images/vw11.JPG"),
        width: 2,
        height: 3
      },
    ];

    const all = gcf.concat(nature.concat(touring.concat(vw)));

    return (
      <div class="misc" id="misc">
        <div className="background2" />

        <Typography variant="h3" className="center1">
          <Slide left>PHOTOS</Slide>
          <Slide left>
            <div className="subhead" />
          </Slide>
        </Typography>
        <div className="misccontainer">
          <Fade delay="200">
            <Slide bottom>
              {/* <GridList cellHeight={height} className="overflow" cols={5}>
                {gcf.map(tile => (
                  <GridListTile key={tile.img} cols={tile.cols || 1}>
                    <div className="picture">
                      <div className="picture3">
                        <a className="none2" href={tile.img} target="_blank">
                          <div className="download">VIEW</div>
                        </a>
                      </div>

                      <img
                        src={tile.img}
                        alt={tile.title}
                        className="picture2"
                      />
                    </div>
                  </GridListTile>
                ))}
                {nature.map(tile => (
                  <GridListTile
                    key={tile.img}
                    cols={tile.cols || 1}
                    className="overflow"
                  >
                    <div className="picture overflow">
                      <div className="picture3 overflow">
                        <a
                          className="none2 overflow"
                          href={tile.img}
                          target="_blank"
                        >
                          <div className="download">VIEW</div>
                        </a>
                      </div>

                      <img
                        src={tile.img}
                        alt={tile.title}
                        className="picture2"
                      />
                    </div>
                  </GridListTile>
                ))}
                {touring.map(tile => (
                  <GridListTile key={tile.img} cols={tile.cols || 1}>
                    <div className="picture">
                      <div className="picture3">
                        <a className="none2" href={tile.img} target="_blank">
                          <div className="download">VIEW</div>
                        </a>
                      </div>

                      <img
                        src={tile.img}
                        alt={tile.title}
                        className="picture2"
                      />
                    </div>
                  </GridListTile>
                ))}
                {vw.map(tile => (
                  <GridListTile key={tile.img} cols={tile.cols || 1}>
                    <div className="picture">
                      <div className="picture3">
                        <a className="none2" href={tile.img} target="_blank">
                          <div className="download">VIEW</div>
                        </a>
                      </div>

                      <img
                        src={tile.img}
                        alt={tile.title}
                        className="picture2"
                      />
                    </div>
                  </GridListTile>
                ))}
              </GridList> */}
              <Gallery photos={all} />
            </Slide>
          </Fade>

        </div>

      </div>
    );
  }
}
